import React from 'react';

import Banner from './components/Banner';
import Team from './components/Team';
import About from './components/About';
import FAQ from './components/FAQ';
import Footer from './components/Footer';

function App() {
  return (
    <div>
      {/* Navbar */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top px-3">
        <a className="navbar-brand logo" href="/">Logo</a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse"
          data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item"><a className="nav-link active" href="/">Home</a></li>
            <li className="nav-item"><a className="nav-link" href="#about">About Us</a></li>
            <li className="nav-item"><a className="nav-link" href="#faq">FAQ</a></li>
            <li className="nav-item"><a className="nav-link" href="#contact">Contact</a></li>
          </ul>
        </div>
      </nav>

      {/* Banner Section */}
      <Banner />

      {/* About Us Section */}
      <section id="about" className="container my-5">
        <About />
      </section>

      {/* Team Section */}
      <section className="container my-5">
        <Team />
      </section>

      {/* FAQ Section */}
      <section id="faq" className="container my-5">
        <FAQ />
      </section>

      {/* Footer */}
      <footer id="contact" className="bg-dark text-white text-center py-4 mt-5">
        <Footer />
      </footer>
    </div>
  );
}

export default App;
